import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <h1>BLoG</h1>
        </Link>
      </div>
      <div className="header-image">
        <img src="" alt="image" />
      </div>
    </header>
  );
};

export default NavBar;
